--
-- Create procedure `Proc_asset_GetPaging`
--
CREATE PROCEDURE Proc_asset_GetPaging (IN v_Offset int, IN v_Limit int, IN v_Sort varchar(100), IN v_Where varchar(1000))
SQL SECURITY INVOKER
BEGIN
  -- =============================================
  -- Author:        BuiQuangDiep
  -- Created date:  11/08/2022
  -- Description:   Lấy danh sách tài sản và tổng số nhân viên có phân trang
  -- Modified by:   
  -- Code chạy thử: CALL `misa.web07.hcsn.diep`.Proc_asset_GetPaging(0, 10, NULL, "EmployeeName like '%Trường%'");
  -- =============================================
  -- IF NULL LÀ 1 HÀM THAM SỐ ĐẦU VÀO
  -- Tham số đầu vào thứ 2 là giá trị mặc định nếu chuỗi kiểm tra là null
  -- Nếu chuỗi kiểm tra không null thì trả vè chính nó
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedDate DESC';
  END IF;

  IF v_Limit = -1 THEN
    SET @filterQuery = CONCAT('SELECT * FROM fixed_asset WHERE ', v_Where, ' ORDER BY ', v_Sort);
  ELSE
    SET @filterQuery = CONCAT('SELECT * FROM fixed_asset WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Offset, ',', v_Limit);
  END IF;

  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  SET @filterQuery = CONCAT('SELECT count(FixedAssetID) AS TotalCount FROM fixed_asset WHERE ', v_Where);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

